import React from "react";

const Navbar = nbrMovies => {
  return (
    <nav className="navbar navbar-light bg-light">
      <span className="navbar-brand mb-0 h1">
        Showing {nbrMovies} movies in database
      </span>
    </nav>
  );
};

export default Navbar;
